Something beautiful happens every year in heart of Detroit. Within the gritty, concrete jungle that is The Russell Industrial Center; artists come together to create with the goal of bring art back to this city and it's youth. It truly is something that must be experienced first hand to fully grasp.

I urge all of my fellow artists, friends, and followers to participate in The Michigan Glass Project in some way if you are able to.

